  [],\n\t\"revision_timestamp\": \"2015-05-07T03:56:43.050074\",\n\t\"name\": \"online-real-time-tribology-failure-detection-system-project-b98cd\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Under NASA Phase I funding, we have developed
  a system for the ball bearing fault detection and identification. Our system can
  effectively identify multiple fault modes related to the evolution of friction within
  the contact in the coated ball bearings. To detect bearing faulty modes, we have
  developed a new bispectrum and entropy analysis method to capture the faulty transient
  signals embedded in the measurements. To classify the fault modes, we further developed
  a set of stochastic models using hidden Markov model (HMM) and Gaussian mixtures.
  Test results using lab experiment data have shown that our system can identify coated
  ball bearing fault modes in near real-time. In Phase II, we will further develop
  and test our system developed in Phase I for spacecraft mechanical parts health
  monitoring and mitigating actions. A thorough understanding of the failure mechanisms
  of the moving parts will emerge by the end of the Phase II effort, as well as the
  methodology to prevent catastrophic failure while in orbit. Algorithms developed
  in Phase I/II will be implemented in C/C++. Effort will be focused on the accuracy,
  autonomous, speed and efficiency of the system. The Boeing Company has teamed with
  us for Phase II effort.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
